import React from 'react'
import { CSVLink } from 'react-csv'
import Button from 'react-bootstrap/Button';

export const ExportReactCSV = () => {
    return (
        <Button variant="warning">
            <CSVLink >Export</CSVLink>
        </Button>
    )
}
